// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract EVoting {
    address public admin;
    uint256 public votingStartTime;
    uint256 public votingEndTime;

    struct Voter {
        string uuid;
        string deviceID;
        bool hasVoted;
    }

    struct Candidate {
        string name;
        uint256 voteCount;
    }

    mapping(string => Voter) public registeredVoters; // ✅ Store registered voters using UUID
    mapping(string => bool) public usedDeviceIDs; // ✅ Prevent multiple registrations from same device
    mapping(string => Candidate) public candidates; // ✅ Store vote counts for candidates
    mapping(string => bool) public hasVoted; // ✅ Prevent duplicate votes

    event VoterRegistered(string voterName, string deviceID, string uuid);
    event VoteCasted(string uuid, string candidate, uint256 totalVotes);
    event VotingTimeSet(uint256 startTime, uint256 endTime);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier duringVotingPeriod() {
        require(block.timestamp >= votingStartTime && block.timestamp <= votingEndTime, "Voting is not active");
        _;
    }

    constructor() {
        admin = msg.sender;
    }

    function setVotingTime(uint256 _startTime, uint256 _endTime) public onlyAdmin {
        require(_startTime < _endTime, "Start time must be before end time");
        votingStartTime = _startTime;
        votingEndTime = _endTime;
        emit VotingTimeSet(_startTime, _endTime);
    }

    function registerVoter(string memory voterName, string memory deviceID) public onlyAdmin returns (string memory) {
        require(bytes(deviceID).length > 0, "Device ID is required");
        require(!usedDeviceIDs[deviceID], "Device already used for registration");

        // ✅ Generate UUID using `voterName + deviceID + timestamp`
        string memory uuid = _generateUUID(voterName, deviceID);

        require(bytes(registeredVoters[uuid].uuid).length == 0, "Voter already registered");

        registeredVoters[uuid] = Voter(uuid, deviceID, false);
        usedDeviceIDs[deviceID] = true; // ✅ Mark device as used

        emit VoterRegistered(voterName, deviceID, uuid);
        return uuid;
    }

    function vote(string memory uuid, string memory candidate) public duringVotingPeriod {
        require(bytes(registeredVoters[uuid].uuid).length != 0, "Voter not registered");
        require(!registeredVoters[uuid].hasVoted, "Voter has already voted");

        registeredVoters[uuid].hasVoted = true; // ✅ Mark voter as voted
        hasVoted[uuid] = true; // ✅ Prevent duplicate votes

        candidates[candidate].voteCount += 1; // ✅ Increment vote count

        emit VoteCasted(uuid, candidate, candidates[candidate].voteCount);
    }

    function getVotes(string memory candidate) public view returns (uint256) {
        return candidates[candidate].voteCount; // ✅ Return vote count
    }

    function checkIfVoted(string memory uuid) public view returns (bool) {
        return hasVoted[uuid];
    }

    function isVoterRegistered(string memory uuid) public view returns (bool) {
        return bytes(registeredVoters[uuid].uuid).length != 0;
    }

    function _generateUUID(string memory voterName, string memory deviceID) internal view returns (string memory) {
        return _toHex(keccak256(abi.encodePacked(voterName, deviceID, block.timestamp)));
    }

    function _toHex(bytes32 data) internal pure returns (string memory) {
        bytes memory alphabet = "0123456789abcdef";
        bytes memory str = new bytes(64);
        for (uint i = 0; i < 32; i++) {
            str[i * 2] = alphabet[uint8(data[i] >> 4)];
            str[1 + i * 2] = alphabet[uint8(data[i] & 0x0f)];
        }
        return string(str);
    }
}

